var weather = function () {
	//setInterval(weather, 30000);
	$.getJSON('//cors-anywhere.herokuapp.com/http://freegeoip.net/json/?callback=', function (jsonp) {
		var country = jsonp.country_name;
		var city = jsonp.city;
		var latitude = jsonp.latitude;
		var longitude = jsonp.longitude;
		$.getJSON('//cors-anywhere.herokuapp.com/http://api.openweathermap.org/data/2.5/weather?lat=' + latitude + '&lon=' + longitude + '&appid=e6aec9dfa866b877e297d150818f77cd', function (json) {
			var kelvin = json.main.temp;
			var celsius = Math.round(kelvin - 273.15);
			var fahrenheit = Math.round((kelvin * (9 / 5)) - 459.67);
			var humidity = json.main.humidity;
			var rain = json.main.rain;
			var thunderstorm = [
        200,
        201,
        202,
        210,
        211,
        212,
        221,
        230,
        231,
        232
      ];
			var drizzle = [
        300,
        301,
        302,
        310,
        311,
        312,
        313,
        314,
        321
      ];
			var rain = [
        500,
        501,
        502,
        503,
        504,
        511,
        520,
        521,
        522,
        531
      ];
			var snow = [
        600,
        601,
        602,
        611,
        612,
        615,
        616,
        620,
        621,
        622
      ];
			var atmosphere = [
        701,
        711,
        721,
        731,
        741,
        751,
        761,
        762,
        771,
        772
      ];
			var clear = 800;
			var cloud = [
        801,
        802,
        803,
        804
      ];
			var id = json.weather[0].id;
			var src;
			if (thunderstorm.indexOf(id) !== -1) {
				src = 'data:image/png;base64,';
			} else if (drizzle.indexOf(id) !== -1) {
				src = 'data:image/png;base64,';
			} else if (rain.indexOf(id) !== -1) {
				src = 'data:image/png;base64,';
			} else if (snow.indexOf(id) !== -1) {
				src = 'data:image/png;base64,';
			} else if (atmosphere.indexOf(id) !== -1) {
				src = 'data:image/png;base64,';
			} else if (id === clear) {
				if (json.weather[0].icon === '01d') {
					src = 'data:image/png;base64,';
				} else {
					src = 'data:image/png;base64,';
				}
			} else if (cloud.indexOf(id) !== -1) {
				src = 'data:image/png;base64,';
			}
			var alt = json.weather[0].main;
			$('#icon').find('img').attr({
				'alt': alt,
				'src': src
			});
			$('#description').text(json.weather[0].description);
			$('#location').text(city + ', ' + country);
			$('#temperature').text(celsius + 'C');
			$('#humidity').text(humidity + ' %');
			$('#rain').text(rain[0] + ' mm');
		});
	});
};
weather();
